const autor = () => {
    return {
        type: 'AUTOR'
    }
}

const like = () => {
    return {
        type: 'LIKE'
    }
}

const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

export {
    autor,
    like,
    addUser
}
